import { ChatIcon } from "@chakra-ui/icons";
import {
  Button,
  Circle,
  Divider,
  HStack,
  Heading,
  Tab,
  Text,
  TabList,
  VStack,
} from "@chakra-ui/react";
import React from "react";

const SideBar = () => {
  return (
    <VStack py="1.4rem">
      <HStack justify="space-evenly" w="100%">
        <Heading size="md">Add Friend</Heading>
        <Button>
          <ChatIcon />
        </Button>
      </HStack>
      <Divider />
      <VStack as={TabList}>
        <HStack as={Tab}>
          <Circle color="red.500" w="50px" h="50px" />
          <Text>Abhishek</Text>
        </HStack>
      </VStack>
    </VStack>
  );
};

export default SideBar;
